        hereinafter known as "1st party," and
            [color=#002AAF]Sample 2nd Party[/color]
          ‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾
        hereinafter known as "2nd party," and collectively known as the "Parties"


        This agreement is created for the purpose of preventing the unauthorized disclosure of the confidential and proprietary information (the "Confidential Information").


        The parties agree as follows:


        [head=3]2. AGREEMENT TYPE[/head][bold] — Check one (1):[/bold]


        \[  ] [bold]Unilateral[/bold] — This agreement shall be Unilateral, whereas 1st Party shall have sole ownership of the Confidential Information with 2nd Party being prohibited from disclosing the Confidential Information to be released by the 1st party.


        \[  ] [bold]Mutual[/bold] — This agreement shall be Mutual, whereas the Parties shall be prohibited from disclosing the Confidential Information that is to be shared between one another.


        [head=3]3. RELATIONSHIP[/head]

        1st Party's relationship to 2nd Party can be described as
            [color=#002AAF]Sample[/color]
          ‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾‾
