        [head=3]5. DURATION[/head]

        The bounded Party's(ies) duty to hold the Confidential Information in confidence shall remain in effect until the following condition is reached

        \[  ] Such information no longer qualifies as a trade secret

        \[  ] Written notice is given releasing such Party from this Agreement

